css:
@-moz-document domain("docs.google.com") {
/* header */
.docs-og-minibar, #docs-menubars, .native-scrollbar {
	background-color: #aaa;   
}

/* header & footer toolbars */
#docs-toolbar-wrapper, #docs-toolbar-wrapper > DIV, #grid-bottom-bar {
	background: #bbb;   
}

/* formula label */
#t-formula-bar-label {
    background-color: #aaa;
    border-right: 1px solid #888;
}

/* formula field */
#t-formula-bar-input-container, #t-formula-bar-input-container #t-formula-bar-input, #t-formula-bar-input-container .cell-input {
    background-color: #ddd;
}

/* sheet tabs */
.docs-sheet-tab {
    background-color: #aaa;  
}

.docs-sheet-active-tab {
    background-color: #ccc;  
}


.docs-sheet-message-container-button {
    background: #ccc;  
}
}
